import "./CarouselDots.css";

function CarouselDots(props) {
  return (
    <div className="carousel-dots-container">
      <div className="carousel-dot selected-dot" id="dot1">
        &nbsp;
      </div>
      <div className="carousel-dot " id="dot2" onClick={props.dotHandlerTunnel}>
        &nbsp;
      </div>
      <div className="carousel-dot " id="dot3" onClick={props.dotHandlerTunnel}>
        &nbsp;
      </div>
      <div className="carousel-dot " id="dot4" onClick={props.dotHandlerTunnel}>
        &nbsp;
      </div>
    </div>
  );
}

export default CarouselDots;
